#include <bits/stdc++.h>
using namespace std;

vector<array<int, 10>> opp;

struct chromo {
    array<int, 9> div;
    array<int, 10> vals;
    pair<int, int> fitness;

    void get_vals() {
        sort(div.begin(), div.end());
        int prev = 0;
        for (int i = 0; i < 9; i++) {
            vals[i] = div[i] - prev;
            prev = div[i];
        }
        vals[9] = 100 - prev;
    }

    void get_fitness() {
        fitness = {0, 0};
        for (int i = 0; i < ssize(opp); i++) {
            int our_score = 0, opp_score = 0;
            for (int j = 0; j < 10; j++) {
                if (vals[j] > opp[i][j]) {
                    our_score += j + 1;
                }
                if (opp[i][j] > vals[j]) {
                    opp_score += j + 1;
                }
            }
            if (our_score > opp_score) {
                fitness.first++;
            }
            if (our_score == opp_score) {
                fitness.second++;
            }
        }
    }

    chromo() {
        for (int i = 0; i < 9; i++) {
            div[i] = rand() % 101;
        }
        get_vals();
        get_fitness();
    }

    void mutate(int v) {
        for (int i = 0; i < 9; i++) {
            if (rand() % 100 < 30) {
                div[i] = clamp(div[i] + rand() % (2 * v + 1) - v, 0, 100);
            }
        }
        get_vals();
        get_fitness();
    }

    friend chromo cross(const chromo &a, const chromo &b) {
        chromo res = b;
        for (int i = 0; i < rand() % 10; i++) {
            res.div[i] = a.div[i];
        }
        res.get_vals();
        res.get_fitness();
        return res;
    }
};

int main() {
    freopen("opponents.txt", "r", stdin);

    srand(chrono::steady_clock::now().time_since_epoch().count());

    ios::sync_with_stdio(false);
    cin.tie(nullptr);

    int idx = 0;
    for (int x; cin >> x;) {
        if (idx == 0) {
            opp.emplace_back();
        }
        opp.back()[idx] = x;
        idx = (idx + 1) % 10;
        if (cin.peek() == ',') {
            cin.ignore();
        }
    }

    const int POP_SZ = 1e5;

    vector<chromo> pop(POP_SZ);
    for (int gen = 0; gen < 100; gen++) {
        sort(pop.begin(), pop.end(), [&](chromo a, chromo b) {
            return a.fitness > b.fitness;
        });

        // Output the current state of the population
        cout << "GENERATION #" << gen << ": " << pop[0].fitness.first << ' ' << pop[0].fitness.second << '\n';
        for (int j = 0; j < 10; j++) {
            cout << pop[0].vals[j] << ' ';
        }
        cout << endl;

        vector<chromo> new_pop;
        new_pop.reserve(POP_SZ);

        // Retain the top 10% of the old population
        for (int j = 0; j < POP_SZ / 10; j++) {
            new_pop.push_back(pop[j]);
        }

        // Form offspring from the top 50%
        for (int j = 0; j < POP_SZ - POP_SZ / 10; j++) {
            int a = rand() % (POP_SZ / 2);
            int b = rand() % (POP_SZ / 2);
            chromo child = cross(pop[a], pop[b]);
            if (rand() % 100 < 15) {
                child.mutate(100 - gen);
            }
            new_pop.push_back(child);
        }

        pop = new_pop;
    }
}

