#include <algorithm>
#include <cstdint>
#include <iostream>
#include <vector>

using namespace std;

std::int64_t fun(std::vector<std::int64_t> s, std::int64_t i = 0, bool canJump = true) {
  if (i == s.size()) return 1;
  if (i > s.size()) return 0;

  if ((s.at(i) == 2 || s.at(i) == 1) && canJump && (i + 1 < s.size()) &&
      (s.at(i + 1) <= 6)) {
    return fun(s, i + 1) + fun(s, i + 2);
  }

  return fun(s, i + 1);
}

std::int64_t funDP(std::vector<std::int64_t> s) {
  std::vector<std::int64_t> DP(s.size() + 2);
  DP.at(0) = 1;

  for (std::int64_t i = 0; i < s.size(); i++) {
    DP.at(i + 1) = DP.at(i + 1) ? DP.at(i + 1) : DP.at(i);
    if (s.at(i) == 1 ||
        (s.at(i) == 2 && (i + 1 < s.size()) && s.at(i + 1) <= 6)) {
      // std::cout << "DGB " << DP.at(i) << " " << DP.at(i + 1) << "\n";
      DP.at(i + 2) = DP.at(i) + DP.at(i + 1);
    }
  }

  return DP.at(s.size());
}

int main() {
  vector<std::int64_t> V{2, 2, 2, 1};

  string s;

  do {
    cin >> s;
    if (s == "0") break;

    vector<std::int64_t> s_c;
    s_c.reserve(s.size());

    for (char c : s) {
      s_c.push_back(static_cast<std::int64_t>(c) - '0');
    }

    std::cout << funDP(s_c) << std::endl;
  } while (s != "0");
  return 0;
}

using System;
using System.Collections.Generic;

namespace StoreQueue
{
    internal class Program
    {
        static void Main(string[] args)
        {
            Queue<int> storeQueue = new Queue<int>();

            Random random = new Random();

            int randomValueMin = 0;
            int randomValueMax = 101;

            int queueSize = 10;
            int revenueCurrent = 0;

            string queueEndingConfirmation = "  .";
            string shutdownMessage = " ...";
            string customersShowingMessage = " :";

            for (int i = 0; i < queueSize; i++)
            {
                int purchaseValue = random.Next(randomValueMin, randomValueMax);
                storeQueue.Enqueue(purchaseValue);

            }

            Console.WriteLine(customersShowingMessage);

            ShowAllCustumers(storeQueue);

            for (int i = 0; i < queueSize; i++)
            {

                int purchaseValueNext = storeQueue.Dequeue();

                string purchaseMessage = " " + (i + 1) + ": $" + purchaseValueNext;

                revenueCurrent += purchaseValueNext;

                string revenueCurrentReport = "  : $" + revenueCurrent + ";";

                Console.WriteLine(purchaseMessage);
                Console.WriteLine(revenueCurrentReport);

                Console.ReadKey();

                Console.Clear();
            }

            Console.WriteLine(customersShowingMessage);

            ShowAllCustumers(storeQueue);

            Console.WriteLine(queueEndingConfirmation);

            string revenueTotalReport = "  : $" + revenueCurrent + ".";

            Console.WriteLine(revenueTotalReport);
            Console.WriteLine(shutdownMessage);
            Console.ReadLine();
        }

        static void ShowAllCustumers(Queue<int> queueShown)
        {
            foreach (int customer in queueShown)
            {
                Console.WriteLine(customer);
            }
        }
    }
}

import java.io.BufferedReader;
import java.io.File;
import java.io.FileWriter;
import java.io.InputStreamReader;
import java.io.OutputStream;

import java.net.ServerSocket;
import java.net.Socket;
import java.nio.file.Files;
import java.nio.file.StandardCopyOption;

public class server {
    public static void main(String[] args) throws Exception {
        String fileName = "../build/code.c";
        String compileString = "gcc ../build/code.c -o ../build/codeBin.exe";
        String runString = "../build/codeBin";

        ServerSocket rootSocket = new ServerSocket(9000);

        while(true) {
            System.out.println("Server Started -----");
            Socket connectionSocket = rootSocket.accept();

            File f = new File(fileName);
            Files.copy(connectionSocket.getInputStream(), f.toPath(), StandardCopyOption.REPLACE_EXISTING);
            connectionSocket.close();

            connectionSocket = rootSocket.accept();

            Runtime rt = Runtime.getRuntime();

            Process process = rt.exec(compileString.split(" "));

            String line;
            BufferedReader reader = new BufferedReader(
                    new InputStreamReader(process.getErrorStream()));
            while ((line = reader.readLine()) != null) {
                outToClient.write(line.getBytes());
            }
            reader.close();
            line = "";

            process = rt.exec(runString.split(" "));
            OutputStream outToClient = connectionSocket.getOutputStream();
            reader = new BufferedReader(
                    new InputStreamReader(process.getInputStream()));
            while ((line = reader.readLine()) != null) {
                outToClient.write(line.getBytes());
            }
            reader.close();

            connectionSocket.close();
        }
    }
}
